import React, { Component } from 'react';
import { GoogleComponent } from 'react-google-location' 
import apikey from '../google_api_key'

class Duration extends Component {

    state = {
        origin1 : '',
        destination1 : ''
    }
    render() {
        return(
        <div>
            <span id = "durationtext"> {this.getDuration()} </span>
        </div>
        )
    }
    getDuration(origin1, destination1) {

        var origin1 = 'Lowell, Massachusetts';
        var destination1 = 'Boston, Massachusetts';
        //var service = new google.maps.DistanceMatrixService;
        var service = "http://maps.googleapis.com/maps/api/distancematrix/json?origins=" 
            + origin1 + "&destination=" + destination1 + "&key=" + apikey;
        service.getDistanceMatrix({
            origins: origin1,
            destinations: destination1,
            travelMode: 'DRIVING',
            //unitSystem: google.maps.UnitSystem.METRIC,
            avoidHighways: false,
            avoidTolls: false
        }, callback)

        function callback(response,status){
            if (status == 'OK') {
                var results = response.rows[0].elements;
                var distance = results[0].duration.value;
                return distance;
            }
        }
                /*
                var originList = response.originAddresses;
                var destinationList = response.destinationAddresses;
                var outputDiv = document.getElementById('durationtext');
                outputDiv.innerHTML = ''; 
                for (var i = 0; i < originList.length; i++){
                var results = response.rows[i].elements;
                for (var j = 0; j < results.length; j++){
                    outputDiv.innerHTML += results[j].Duration;
                }
            }
            */
    }
}   

export default Duration;
